import React from 'react'
import AvatarImg from '../../images/person-male.png'

class Icon extends React.Component{

    render(){
        return (
            <div className='icon'>
                <img src={AvatarImg} style={{ width:"50px", float:"right"}}/>
            </div>
        )
    }

}

export default Icon
